## Create a Tooltip in NextJS using React Context

### Create a Tooltip component

First, create a Tooltip component that will be used in different places in the application. The Tooltip component will have a title and a content. The content will be displayed when the user hovers over the title.
```
import React from "react";

const Tooltip = ({ title, content }) => {
  return (
    <div className="tooltip">
      <div className="tooltip-title">{title}</div>
      <div className="tooltip-content">{content}</div>
    </div>
  );
};

export default Tooltip;
```
### Create a TooltipContext

Next, create a TooltipContext that will be used to store the state of the Tooltip component. The TooltipContext will have a value property that will be used to store the state of the Tooltip component.
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
